style = {
    overflow: 'scroll',
    height: '350px'
}

shouldComponentUpdate(){
    return true 
}

feedList = []

updateFeed = () => {
    this.feedList.push(<FeedItem>abcdef</FeedItem>)
    console.log(this.feedList)
}

componentDidUpdate(){
    this.updateFeed()
}

render(){

    return(
    <div style={this.style}>
        <h1>Unregistered Activity</h1>
        {this.feedList.map(value => value)}
    </div>)}
}


